              text: "&lt;p&gt;o příletu jsme měli vyjednané půjčení auta a vybavení pro cestování. Autem byl Nissan DoubleCab 2,4i 4x4 2005, přední uzávěrka, čelní rám, klima, 2 rezervy, 2 plynové bomby, 2 střešní stany, 1 rezervní kanystr (20 l) – základní objem nádrže 140 l, lopata na písek, lednička (která občas měla 35°C),kanystr na užitkovou vodu a kempingové vybavení . Váha cca 2700kg. Auto tedy bylo ustrojeno na objednávku, nyní bych pár věcí už objednal jinak. Půjčují se téměř výhradně japonci alá tento nissan, pak africe vládnou toyoty (hilux, řada hzj) . V půjčovně měli teda i po 1 kusu Hummera H3 a nějakého dodge, kteří si objednali nějací Němci, které tedy upřímně lituji . Cestovalo se po Namibii, Botswaně a Zambii.&lt;/p&gt;&lt;p&gt;Nacestovali jsme asi 7000km, z toho tak 1000 km hlubším pískem, 3000km prašné cesty, 3000 km asfaltky. Zezačátku jsme po nákupu surovin (jídla a hodně moc vody) vyrazili směr poušť Namib, kde jsme se seznamovali s autem (já tedy mám bohaté zkušenosti se 4x4, ale přeci jen africké cesty jsou trošku jiné než na ostatních kontinentech). Vyrazili jsme tedy z hlavního města, kde ještě tak 20km trvala asfaltka, která poté přešla v prašnou. žádné extra výmoly , cestovní rychlost tak 80-130 km/h. GPS navigace počítá s rychlostí 12 km/h, takže doby dojezdu vás trochu znejistí, než zjistíte, že 1 hodinu zvládáte za 5 min. Projetí průsmyku, kde mě zarazila síla motoru. Nebyl na jedničku se schopný rozjet, musela se řadit redukce. S tím jsem se doteď nesetkal v žádném jinem autě. Člověk se na těchto cestách dost klimbá třeba 5 hodin v kuse, ale na to si zvykne. Zrádnost těchto cest spočívá v relativně dobrém povrchu, kde se to dá valit kolem 120km/h, ale občas se projeví terénní vlna nebo zarovnané vyschlé řečiště. To mě vyškolilo hned na počátku, kde jsem jel kolem 130km/h. Následoval skok něco k 10 m poměrně ve výšce, s 2 odrazy po dopadu. V autě to bylo docela v pohodě, ale spolucestující nebyli na terén zvyklí tak trochu remcali. Pružiny ani nešly nadoraz. Následovala cesta k dunám a písku, kde se opět projevila nedostat&lt;/p&gt;",
