  composedIdentifier: "2020/0001",
  currencyId: 1,
  description:
    "Snad tento drobný detail by mohl kolemjdoucím naznačit, že majitelé přišli ze země, kde vládne Vladimir Putin. Sotva by ale někdo hádal, že do hotelu investovala kapitál rodina někdejšího dlouholetého ruského gubernátora z Dálného východu Sergeje Darkina.\n\nNejde přitom zdaleka jen o tento jeden dům v centru města. Při podrobném zkoumání lze najít i další zajímavý majetek. Podnikání Darkinových v Česku se točí hlavně kolem prodeje mořských ryb.\n\nSergej Michajlovič Darkin (58), bývalý mocný politik z Vladivostoku, je příkladem člověka, který nikdy nebyl v nejvyšší sféře moskevských prominentů, tudíž v časech ruské agrese na Ukrajině nefiguruje na evropském sankčním seznamu. Přesto není pochyb o tom, že jde o osobu z Putinova okruhu, jejíž domnělý či skutečný majetek by právě v Česku neměl unikat zájmu úřadů.",
